(ns composed-pine
   (:require
    [opencv3.utils :as u]
    [opencv3.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn load-cvt-resize-show[url]
(-> url
  (u/mat-from-url)
  (cvt-color! COLOR_RGB2GRAY)
  (resize! (new-size 150 200))
  (u/mat-view)))
